import React from "react";
import {
  HashRouter,
  Route,
  Switch,
  NavLink as Link  
} from 'react-router-dom'

import Main from "./components/Main";
import MainApp from './app/MainApp'


function App(){ 
    return (
      <HashRouter>
        <Switch>
          <Route  path="/" component={Main}/>
          <Route path='/mainApp' component={MainApp} />
        </Switch>  
      </HashRouter>
    );

  }


export default App;
